import React from 'react';
import logo from "../../images/Logo.svg";

const Header = () => {
    return (
        <div>
            <nav>
                <img src={logo} alt=""/>
                <div>
                    <a href="/"></a>
                    <a href=""></a>
                    <a href=""></a>
                    <a href=""></a>
                </div>
            </nav>
        </div>
    );
};

export default Header;
